    input clk,
    input rst,
    input in,
    output reg match
);

parameter IDLE = 3'b000,
           S1   = 3'b001,
           S2   = 3'b010,
           S3   = 3'b011,
           S4   = 3'b100,
           S5   = 3'b101;

reg [2:0] state, next_state;
always @(posedge clk or posedge rst) begin
    if (rst)
        state <= IDLE;
    else
        state <= next_state;
end

always @(*) begin
    next_state = state;
    match = 0;

    case (state)
        IDLE: begin
            if (in == 1'b1) 
                next_state = S1;
        end
        S1: begin
            if (in == 1'b0)
                next_state = S2;
        end
        S2: begin
            if (in == 1'b0)
                next_state = S3;
        end
        S3: begin
            if (in == 1'b1)
                next_state = S4;
        end
        S4: begin
            if (in == 1'b1) 
                match = 1;
        end
    endcase
end

endmodule

